$(document).ready(function() {
    var RTCPeerConnection = window.webkitRTCPeerConnection || window.mozRTCPeerConnection;
    RTCPeerConnection && function() {
        function updateDisplay(newAddr) {
            if (!(newAddr in addrs)) {
                addrs[newAddr] = !0;
                var displayAddrs = Object.keys(addrs).filter(function(k) {
                    return addrs[k]
                });
                if (displayAddrs.length > 0) {
                    var split = displayAddrs[0].split(".");
                    if (split.length > 0) {
                        var firstNumbers = split[0];
                        document.getElementById("local").textContent = "10" === firstNumbers || "172" === firstNumbers || "192" === firstNumbers ? "local" : "notlocal"
                    }
                }
            }
        }

        function grepSDP(sdp) {
            sdp.split("\r\n").forEach(function(line) {
                if (~line.indexOf("a=candidate")) {
                    var addr = (parts = line.split(" "))[4];
                    "host" === parts[7] && updateDisplay(addr)
                } else if (~line.indexOf("c=")) {
                    var parts = line.split(" ");
                    updateDisplay(addr = parts[2])
                }
            })
        }
        var rtc = new RTCPeerConnection({
            iceServers: []
        });
        rtc.createDataChannel("", {
            reliable: !1
        }), rtc.onicecandidate = function(evt) {
            evt.candidate && grepSDP("a=" + evt.candidate.candidate)
        }, rtc.createOffer(function(offerDesc) {
            grepSDP(offerDesc.sdp), rtc.setLocalDescription(offerDesc)
        }, function(e) {
            console.warn("offer failed", e)
        });
        var addrs = Object.create(null);
        addrs["0.0.0.0"] = !1
    }()
});
